import React from 'react';
import './header.css';

const Header = () => {
  return (
    <header className="main-header">
      <nav className="nav-container">
        <div className="logo">
          Dashboard
        </div>
        <ul className="nav-list">
          <li className="nav-item">
            <a href="/clock-out" className="nav-link">Clock out</a>
          </li>
          <li className="nav-item">
            <a href="/pos" className="nav-link">POS</a>
          </li>
          <li className="nav-item">
            <a href="/new-design" className="nav-link">New Design</a>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
